import CardsCont from "../../components/CardsCont/CardsCont";
import { useEffect, useState } from "react";
import { useDispatch } from "react-redux";
import { getPokemonsbdd, getPokemonsapi } from "../../redux/actions";
import axios from "axios";

const [pokemons, setPokemons] = useState([]);


const Home = () => {
    const dispatch = useDispatch();

    useEffect(() => {

        const material = [];
        for (let i = 1; i < 100; i++) {

            material.push(
                axios.get(`http://localhost/pokemon/get/${i}`)
            );
        }
        Promise.all(material).then((result) => {
            let newPokemons = [];

            result.map(
                (poke) => (newPokemons = [...newPokemons, ...poke.data.results])
            )
        })

        setPokemons(pokemons);
        dispatch()
    }, [])

    return (
        <>
            <hr></hr>
            <h1> HOME </h1>
            <h4>pokemones:</h4>
            <CardsCont />
            <button>pag siguiente</button>
            <hr></hr>
        </>
    )
}

export default Home;
